    $('menu_icon').click(function() {
        $('menu_icon').toggleClass('active');
        $('')
    })

    return (
        <div className="Header">
            <h2>QuizzApp</h2>
            <div className='menu_icon'>
                <FontAwesomeIcon icon={faBars} className='faBars' />
            </div>
            <nav className='navBar'>
                <ul>
                    <li><a href='/'>Home</a></li>
